import React from 'react';

class NewEntry extends React.Component {
    render() {


        return (
            <div className='newEntry col-xs-4'>
                <form>
                <div className="form-group">
                    <select multiple class="form-control" id="activityTypeInput" name="activityType">
                        <option name="Running">Running</option>
                        <option>Walking</option>
                        <option>Swimming</option>
                        <option>Roller skating</option>
                    </select>
                </div>      
                <div className="form-group">      
                        <input type="number" placeholder="Distance" id="distanceInput" name="distance" className="form-control"></input>
                </div>
                <div className="form-group">
                        <input type="submit" value="Dodaj" id="submitInput" name="submitForm" className="btn btn-primary"></input>
                </div>
            
                </form>
            </div>
        )
    };
};

export default NewEntry;
